import React from 'react'
import {TodoList} from './TodoList'
export const Todos = (props) => {
    return (
        <div className="container">
            <h2 className="text-center my-3">My Todo App</h2>
            {props.todos.map((todo)=>{
                return <TodoList todo={todo}/>
                }
                )}
            
        </div>
    )
}
